import React from 'react';

const Card = (data) => (
    <div className='card'>
        <div className='card__picture'>
            <img src={"../img/62050 1.png"} alr={data.name}/>
        </div>
        <p>{data.name}</p>
        <p>{data.cost}</p>
        {console.log(data)}
    </div>
)

export default Card;
